  id: number;
  name: string;
  scheduled_to: string;
}

function AdminPage() {
  const [users, setUsers] = useState<User[]>({id: '', name: '', scheduled_to:''});

  async function getUsers() {
    setUsers(await Axios.get("http://localhost:3003/culto"));
